    render() {
        const { children } = this.props;
        return (
            <Container>
            <Segment inverted attached="top">
                <Header textAlign="center">
                    Currency Converter
                </Header>
            </Segment>
                {children}
            </Container>
        );
    }
}

export default HeaderComp;
